pragma solidity ^0.6.0;

import '../Treasury/TreasuryInterface.sol';

import '../FundRules/GX_SimpleCloseEndRules.sol';
import './GX_FundManagerBaseInterface.sol';
import '../Composition/GX_DEXManagerReference.sol';
import '../Composition/GX_SharesReference.sol';
import '../Tokens/GX_PortfolioTKNInterface.sol';
import '../Governance/GX_GovernanceInvestor.sol';
import '../Governance/GX_GovernanceTrader.sol';
import '../Treasury/GX_Treasury.sol';

import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

/// @author Solidity Services
/// @title Galaxis: Fund manager contract
/// @notice Single entry point for fund management
contract GX_FundManager is GX_SimpleCloseEndRules, GX_FundManagerBaseInterface, GX_DEXManagerReference, GX_GovernanceInvestor, GX_GovernanceTrader, GX_SharesReference, GX_Treasury {
    using SafeMath for uint256;

    /// STATE VARIABLES : core right system and contract composition

    /// @notice name of the fund in the blockchain
    string public name;
    /// @notice details of the fund in the blockchain
    string public details;

    /// EVENTS: user facing events
    /// @notice event for making an investment
    event GX_Deposit(address indexed tknAddress, address indexed investor, uint amount);
    /// @notice event for withdrawing
    event GX_Withdraw(address indexed tknAddress, address indexed to, uint amount);

    /// CONSTRUCTORS

    /// @notice creating a Fund Manager
    /// @dev ...
    constructor(string memory _name, string memory _details) public {
        name = _name;
        details = _details;
    }

    /// TRANSACTIONS

    /// @notice Fund manager deposit token fund
    function deposit(address _tknAddress, address _depositorAccount, uint _amount) public override onlyInvestor {
        require(super.isAllowedDeposit(_tknAddress, _amount), "Galaxis: not allowed to deposit");

        // allowed the amount of token to deposit
        IERC20 depositToken = IERC20(_tknAddress);
        require(depositToken.allowance(_depositorAccount, address(this)) >= _amount,"Galaxis: deposit is not allowed");

        // transfer to treasury
        depositToken.transferFrom(_depositorAccount, address(this), _amount);

        // compute shares to issue based on the changing rate
        uint sharesToIssue = (_amount * getChangeRate(_tknAddress)) / 100; 

        // issue shares
        GX_PortfolioTKNInterface shares = GX_PortfolioTKNInterface(SharesReference);
        shares.mint(_depositorAccount, sharesToIssue);

        // raise event
        emit GX_Deposit(_tknAddress, _depositorAccount, _amount);
    }

    /// @notice withdraw token fund from the fund manager
    /// @dev ...
    /// @param _tknAddress token address of the withdraw amount
    /// @param _depositorAccount to the depositor account
    /// @param _amount the amount to withdraw
    function withdraw(address _tknAddress, address _depositorAccount, uint _amount) public override onlyInvestor {
        require(super.isAllowedWithdraw(_tknAddress, _amount), "Galaxis: not allowed to withdraw");

        // allowed the amount of token to burn as portfolio
        GX_PortfolioTKNInterface shares = GX_PortfolioTKNInterface(SharesReference);
        require(shares.allowance(_depositorAccount, address(this)) >= _amount,"Galaxis: withdraw is not allowed");

        // calculate withdraw amount based on reverse change rate and traderMarge
        uint amountToTransfer = ((_amount * 100 ) / getChangeRate(_tknAddress));

        // transfer from treasury
        transferTokenTreasury(_tknAddress,_depositorAccount,amountToTransfer);

        // burn shares
        shares.burn(_depositorAccount, _amount);

        // raise event
        emit GX_Withdraw(_tknAddress, _depositorAccount, _amount);
    }

    /// @notice placing order to an exchange
    /// @dev ...
    /// @param _dex dex exchange or adapter number
    /// @param _tknOffer token to offer
    /// @param _tknGet token to get
    /// @param _amount amount to exchange
    /// @param _rate rate of the expected change
   function placeOrder(uint8 _dex, address _tknOffer, address _tknGet, uint _amount, uint _rate) public override onlyTrader {
        require(super.isAllowedPlaceOrder(), "Galaxis: not allowed to placer order");

        // have enough token
        require((getBalanceTokenTreasury(_tknOffer) >= _amount), "Galaxis: not enough token to place order");

        //give DEX manager access to the token
        approveTokenTreasury(_tknOffer, DEXManagerReference, _amount);

        // delegate call to the DEX manager
        GX_GeneralOrderInterface dexManager = GX_GeneralOrderInterface(DEXManagerReference);
        dexManager.placeOrder(_dex, _tknOffer,_tknGet,_amount, _rate);
   }

    /// @notice placing order to an exchange
    /// @dev ...
    /// @param _orderId cancelling the order id
   function cancelOrder(uint256 _orderId) public override onlyTrader {

        revert("Galaxis: cancel order is not implemented");

        // delegate call to the DEX manager
        // GX_GeneralOrderInterface dexManager = GX_GeneralOrderInterface(DEXManagerReference);
        // dexManager.cancelOrder(_orderId);
   }

    /// @notice killing the fund contract
    /// @dev ...
    function killFund() public onlyAdmin {
        require((isLocked), "Galaxis: only locked funds can be closed");

        // selfdestruct
        selfdestruct(address(0));
    }

    /// @notice Fallback function: not supported
    /// @dev ...
    fallback() external {
        revert("Galaxis: Fallback is not supported");
    }

    /// VIEWS

    /// UTILS


}

